import React, { useState, useRef } from 'react';
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  ScrollView,
  KeyboardAvoidingView,
  Platform,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import SafeMitraLogo from '../../components/SafeMitraLogo';

const MobileRegistrationScreen = ({ navigation }) => {
  const [fullName, setFullName] = useState('');
  const [mobileNumber, setMobileNumber] = useState('');
  const [pin, setPin] = useState('');
  const [confirmPin, setConfirmPin] = useState('');
  const [showPin, setShowPin] = useState(false);
  const [showConfirmPin, setShowConfirmPin] = useState(false);
  const [acceptedTerms, setAcceptedTerms] = useState(false);
  const [otp, setOtp] = useState(['', '', '', '', '', '']);
  const [isOtpSent, setIsOtpSent] = useState(false);
  const [isOtpVerified, setIsOtpVerified] = useState(false);

  // Create refs for OTP inputs
  const otpInputs = useRef([...Array(6)].map(() => React.createRef()));

  const handleMobileNumberChange = (text) => {
    // Remove any non-digit characters
    const cleanNumber = text.replace(/[^0-9]/g, '');
    
    // Only take first 10 digits
    const truncatedNumber = cleanNumber.slice(0, 10);
    
    setMobileNumber(truncatedNumber);
  };

  const handleSendOtp = () => {
    if (!mobileNumber || mobileNumber.length !== 10) {
      alert('Please enter a valid 10-digit mobile number');
      return;
    }
    // TODO: Implement actual OTP sending logic here
    setIsOtpSent(true);
  };

  const handleOtpChange = (value, index) => {
    // Only allow digits
    if (!/^\d*$/.test(value)) {
      return;
    }

    const newOtp = [...otp];
    newOtp[index] = value;
    setOtp(newOtp);

    // Auto-focus next input or verify OTP if all filled
    if (value !== '') {
      if (index < 5) {
        // Focus next input
        otpInputs.current[index + 1].focus();
      } else if (index === 5) {
        // Verify OTP
        const otpValue = newOtp.join('');
        if (otpValue.length === 6) {
          // TODO: Implement actual OTP verification logic here
          setIsOtpVerified(true);
        }
      }
    }
  };

  const handleOtpKeyPress = (event, index) => {
    // Handle backspace
    if (event.nativeEvent.key === 'Backspace' && index > 0 && !otp[index]) {
      otpInputs.current[index - 1].focus();
      const newOtp = [...otp];
      newOtp[index - 1] = '';
      setOtp(newOtp);
    }
  };

  const handleRegister = () => {
    if (!isOtpVerified) {
      alert('Please verify your mobile number first');
      return;
    }
    if (!fullName || !pin || !confirmPin) {
      alert('Please fill in all fields');
      return;
    }
    if (pin !== confirmPin) {
      alert('PINs do not match');
      return;
    }
    if (!acceptedTerms) {
      alert('Please accept the Terms of Use and Privacy Policy');
      return;
    }

    // Proceed to voice training
    navigation.navigate('VoiceTraining');
  };

  return (
    <KeyboardAvoidingView
      behavior={Platform.OS === 'ios' ? 'padding' : 'height'}
      style={styles.container}
    >
      <ScrollView contentContainerStyle={styles.scrollContainer}>
        {/* Header */}
        <View style={styles.header}>
          <TouchableOpacity
            style={styles.backButton}
            onPress={() => navigation.navigate('Splash')}
          >
            <Ionicons name="arrow-back" size={24} color="#d32f2f" />
          </TouchableOpacity>
          <View style={styles.logoContainer}>
            <SafeMitraLogo color="#d32f2f" size={30} />
            <Text style={styles.logoText}>SafeMitra</Text>
          </View>
          <View style={styles.headerRight} />
        </View>

        <View style={styles.formContainer}>
          <Text style={styles.title}>Register with Mobile Number</Text>
          <Text style={styles.subtitle}>Enter basic details to get started</Text>

          {/* Mobile Number Input with Verification */}
          <View style={styles.inputContainer}>
            <Text style={styles.label}>Mobile Number</Text>
            <View style={styles.mobileInputContainer}>
              <TextInput
                style={[styles.input, styles.mobileInput]}
                placeholder="Enter 10 digit mobile number"
                keyboardType="number-pad"
                value={mobileNumber}
                onChangeText={handleMobileNumberChange}
                editable={!isOtpVerified}
                maxLength={10}
              />
              {isOtpVerified && (
                <View style={styles.verifiedIcon}>
                  <Ionicons name="checkmark-circle" size={24} color="#4CAF50" />
                </View>
              )}
            </View>
            {!isOtpSent && mobileNumber.length === 10 && (
              <TouchableOpacity
                style={styles.sendOtpButton}
                onPress={handleSendOtp}
              >
                <Text style={styles.sendOtpButtonText}>Send OTP</Text>
              </TouchableOpacity>
            )}
          </View>

          {/* OTP Input */}
          {isOtpSent && !isOtpVerified && (
            <View style={styles.otpContainer}>
              <Text style={styles.label}>Enter OTP</Text>
              <View style={styles.otpInputContainer}>
                {otp.map((digit, index) => (
                  <TextInput
                    key={index}
                    ref={(ref) => (otpInputs.current[index] = ref)}
                    style={styles.otpInput}
                    maxLength={1}
                    keyboardType="number-pad"
                    value={digit}
                    onChangeText={(value) => handleOtpChange(value, index)}
                    onKeyPress={(event) => handleOtpKeyPress(event, index)}
                  />
                ))}
              </View>
            </View>
          )}

          {/* Rest of the form - only shown after OTP verification */}
          {isOtpVerified && (
            <>
              {/* Full Name Input */}
              <View style={styles.inputContainer}>
                <Text style={styles.label}>Full Name</Text>
                <TextInput
                  style={styles.input}
                  placeholder="e.g., Riya Sharma"
                  value={fullName}
                  onChangeText={setFullName}
                />
              </View>

              {/* Create PIN Input */}
              <View style={styles.inputContainer}>
                <Text style={styles.label}>Create PIN</Text>
                <View style={styles.pinInput}>
                  <TextInput
                    style={[styles.input, { flex: 1 }]}
                    placeholder="****"
                    secureTextEntry={!showPin}
                    value={pin}
                    onChangeText={setPin}
                    maxLength={4}
                    keyboardType="numeric"
                  />
                  <TouchableOpacity
                    style={styles.eyeIcon}
                    onPress={() => setShowPin(!showPin)}
                  >
                    <Ionicons
                      name={showPin ? 'eye-off' : 'eye'}
                      size={24}
                      color="#666"
                    />
                  </TouchableOpacity>
                </View>
              </View>

              {/* Confirm PIN Input */}
              <View style={styles.inputContainer}>
                <Text style={styles.label}>Confirm PIN</Text>
                <View style={styles.pinInput}>
                  <TextInput
                    style={[styles.input, { flex: 1 }]}
                    placeholder="****"
                    secureTextEntry={!showConfirmPin}
                    value={confirmPin}
                    onChangeText={setConfirmPin}
                    maxLength={4}
                    keyboardType="numeric"
                  />
                  <TouchableOpacity
                    style={styles.eyeIcon}
                    onPress={() => setShowConfirmPin(!showConfirmPin)}
                  >
                    <Ionicons
                      name={showConfirmPin ? 'eye-off' : 'eye'}
                      size={24}
                      color="#666"
                    />
                  </TouchableOpacity>
                </View>
              </View>

              {/* Terms and Conditions */}
              <View style={styles.termsContainer}>
                <TouchableOpacity
                  style={styles.checkbox}
                  onPress={() => setAcceptedTerms(!acceptedTerms)}
                >
                  <Ionicons
                    name={acceptedTerms ? 'checkbox' : 'square-outline'}
                    size={24}
                    color="#d32f2f"
                  />
                </TouchableOpacity>
                <Text style={styles.termsText}>
                  I agree to the{' '}
                  <Text style={styles.termsLink}>Privacy Policy</Text> &{' '}
                  <Text style={styles.termsLink}>Terms of Use</Text>
                </Text>
              </View>

              {/* Register Button */}
              <TouchableOpacity
                style={styles.registerButton}
                onPress={handleRegister}
              >
                <Ionicons name="shield-checkmark" size={24} color="#FFFFFF" />
                <Text style={styles.registerButtonText}>Register Securely</Text>
              </TouchableOpacity>

              {/* Encryption Notice */}
              <View style={styles.encryptedContainer}>
                <Ionicons name="lock-closed" size={16} color="#999" />
                <Text style={styles.encryptedText}>
                  Your information is end-to-end encrypted
                </Text>
              </View>
            </>
          )}

          {/* Login Link */}
          <View style={styles.loginContainer}>
            <Text style={styles.loginText}>Already have an account? </Text>
            <TouchableOpacity onPress={() => navigation.navigate('Login')}>
              <Text style={styles.loginLink}>Login â†’</Text>
            </TouchableOpacity>
          </View>
        </View>
      </ScrollView>
    </KeyboardAvoidingView>
  );
};

